import React, { Component } from 'react';
import './styles/feedbackStyle.css';

export default class Home extends Component {
    render() {
        return (
            <div className="formStyle">
                <h2>Honest Feedback</h2>
                <form>
                    {/* Subject line */}
                    <label className="subjectStyle">Subject</label> <br />
                    <input 
                        type="text" 
                        id="submitForm"
                        className="subjectStyle"
                        rows={5}
                        cols={70} /> <br />

                    {/* Feedback section */}
                    <label className="feedbackStyle">Feedback</label><br />
                    <textarea 
                        id="feedbackForm"
                        rows={10}
                        cols={70} />

                    {/* Submit Button */}
                    <button>Submit</button>
                </form>
            </div>
        )
    }
}
